🇮🇹😃 Our Prosciutto Paradise! 🇮🇹 Another amazing culinary opportunity in #Parma as Tony and I visit Pelacci Callisto Prosciuttificio - an artisinal #prosciutto factory holding true to the region's centuries-old curing traditions.  Located near my family's home in the burgh of Traversetolo, we had an exclusive guided #tour by co-proprietor, Giuliano Pelacci who, along with his brother Alessandro, continue to produce high quality prosciutto (cured Italian ham), carrying on the legacy left behind by their #father and #grandfather before them.  I was so excited to share this experience with my cousin, Marco and can't thank my cousin Patrizia enough for making this day happen!! I could spend our entire #Italian holiday traveling throughout this famous culinary area! 

Cured by hand - while most factories have opted to machines -  Pelacci produces 800 prosciutti per week which are aged in-house anywhere from 1-2 years. These ancient #family traditions are protected by Italy's #DOP certification.  Absolutely to die for! BUON APPETITO. 

